import React from 'react'
import { Container } from '@mui/material'
import { Box } from '@mui/system'

function ClientesBusqueda() {
const boxStyle = {sx:{
    width:'100vw',
    backgroundColor:'lightGrey'}}


  return (
    <Container>
    <Box {...boxStyle}>
    <div>ClientesBusqueda</div>
    </Box>
    </Container>
  )
}

export default ClientesBusqueda
